In this part, we're going to learn how to output messages to the GUI console, find a UObject by name, and output that name to the GUI console. Add #include <DynamicOutput/DynamicOutput.hpp> under #include <Mod/CppUserModBase.hpp>. You can now also remove #include <stdio.h> because we'll be removing the use of printf which was the only thing that required it. To save some time and annoyance and make the code look a bit better, add this line below all the includes: using namespace RC; Replace the call to printf in the body of the MyAwesomeMod constructor with: Output::send<LogLevel::Verbose>(STR("MyAwesomeMod says hello\n")); It's longer than a call to printf, but in return the message gets propagated to the log file and both the regular console and the GUI console. We also get some support for colors via the LogLevel enum. Add this below the DynamicOutput include: #include <Unreal/UObjectGlobals.hpp>
#include <Unreal/UObject.hpp> Let's again utilize the using namespace shortcut by adding this below the first one: using namespace RC::Unreal; Add this function in your mod class: auto on_unreal_init() -> void override
{ // You are allowed to use the 'Unreal' namespace in this function and anywhere else after this function has fired. auto Object = UObjectGlobals::StaticFindObject(nullptr, nullptr, STR("/Script/CoreUObject.Object")); Output::send<LogLevel::Verbose>(STR("Object Name: {}\n"), Object->GetFullName());
} Note that Output::send doesn't require a LogLevel and that we're using {} in the format string instead of %s. The Output::send function uses std::format in the back-end so you should do some research around std::format or libfmt if you want to know more about it. Right click your project and hit Build.

